import { Link } from 'react-router-dom';
const PRODUCTS = [
  {
    id: p1, title: 'Product 1'
  }
];
const Products = () => {
  return <>
    <h1> The Products Page</h1>
    <ul>
      <li><Link to >Product 1</Link></li>
      <li><Link>Product 2</Link></li>
      <li><Link>Product 3</Link></li>
    </ul>
  </>;
};
export default Products;
